// src/components/AdminLogin.jsx
import React, { useState } from 'react';
import { supabase } from '../supabaseClient';
import './AdminLogin.css';

const AdminLogin = ({ onLoginSuccess }) => {
  const [loginData, setLoginData] = useState({ email: '', password: '' });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setLoginData(prev => ({ ...prev, [name]: value }));
  };

  // CREATE ADMIN USER FUNCTION - IMPORTANTE!
  const createAdminUser = async () => {
    try {
      setLoading(true);
      setError('');

      // 1. Gumawa ng user sa Supabase Auth
      const { data: authData, error: authError } = await supabase.auth.signUp({
        email: 'admin@ptc.edu.ph',
        password: 'demo123',
      });

      if (authError) throw authError;

      console.log('Auth user created:', authData);

      if (authData.user) {
        // 2. I-check muna kung existing na sa admin_users table
        const { data: existingAdmin } = await supabase
          .from('admin_users')
          .select('id')
          .eq('id', authData.user.id)
          .single();

        if (!existingAdmin) {
          // 3. Idagdag sa admin_users table kung wala pa
          const { error: adminError } = await supabase
            .from('admin_users')
            .insert([
              {
                id: authData.user.id,
                email: 'admin@ptc.edu.ph',
                full_name: 'PTC Administrator',
                role: 'super_admin'
              }
            ]);

          if (adminError) {
            console.log('Note: Admin might already exist:', adminError);
          }
        }

        setError('‚úÖ Admin user created successfully! You can now login.');
        setLoginData({ email: 'admin@ptc.edu.ph', password: 'demo123' });
      }

    } catch (error) {
      console.error('Create admin error:', error);
      setError('Failed to create admin: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  const handleLogin = async (e) => {
    e.preventDefault();

    if (!loginData.email || !loginData.password) {
      setError('Please fill in all fields');
      return;
    }

    try {
      setLoading(true);
      setError('');

      // 1) Sign in using Supabase Auth
      const { data: authData, error: authError } = await supabase.auth.signInWithPassword({
        email: loginData.email,
        password: loginData.password,
      });

      if (authError) throw authError;
      const user = authData?.user;
      if (!user) throw new Error('Authentication failed.');

      // 2) Check admin_users table for this user id
      const { data: adminRow, error: adminError } = await supabase
        .from('admin_users')
        .select('id, full_name, role, email')
        .eq('id', user.id)
        .single();

      if (adminError || !adminRow) {
        // not an admin -> sign out and deny
        await supabase.auth.signOut();
        throw new Error('Access denied. Admin account required.');
      }

      // SUCCESS
      onLoginSuccess && onLoginSuccess({ user, admin: adminRow });

    } catch (err) {
      console.error('Login error:', err);
      setError(err.message || 'Invalid email or password');
    } finally {
      setLoading(false);
    }
  };

  const handleDemoLogin = () => {
    setLoginData({ email: 'admin@ptc.edu.ph', password: 'demo123' });
    setError('');
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <div className="login-header">
          <div className="logo-container">
            <img src="/logo-ptc.png" alt="PTC Logo" className="logo-image" />
          </div>
          <div className="college-info">
            <h1 className="college-name">Pateros Technological College</h1>
            <p className="login-title">Admin Portal</p>
          </div>
        </div>

        <form onSubmit={handleLogin} className="login-form" noValidate>
          {error && <div className="error-message" role="alert">‚ö†Ô∏è {error}</div>}

          <div className="form-group">
            <label htmlFor="email">Admin Email</label>
            <input
              type="email"
              id="email"
              name="email"
              value={loginData.email}
              onChange={handleInputChange}
              placeholder="admin@ptc.edu.ph"
              disabled={loading}
              required
              autoComplete="username"
            />
          </div>

          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              name="password"
              value={loginData.password}
              onChange={handleInputChange}
              placeholder="Enter your password"
              disabled={loading}
              required
              autoComplete="current-password"
            />
          </div>

          <button type="submit" className="login-button" disabled={loading}>
            {loading ? (
              <>
                <div className="loading-spinner-small" aria-hidden="true"></div>
                Signing In...
              </>
            ) : (
              'üîê Sign In'
            )}
          </button>

          <button type="button" className="demo-login-button" onClick={handleDemoLogin} disabled={loading}>
            üöÄ Fill Demo Credentials
          </button>

          {/* IMPORTANT: ADD THIS BUTTON */}
          <button 
            type="button" 
            className="create-admin-button" 
            onClick={createAdminUser} 
            disabled={loading}
            style={{
              marginTop: '10px',
              background: '#28a745',
              width: '100%',
              padding: '12px',
              fontSize: '14px'
            }}
          >
            ‚ö° Create Admin Account First
          </button>
        </form>

        <div className="login-footer">
          <p>Restricted Access - Authorized Personnel Only</p>
          <p style={{ fontSize: '12px', color: '#666', marginTop: '5px' }}>
            First time? Click "Create Admin Account" above
          </p>
        </div>
      </div>
    </div>
  );
};

export default AdminLogin;
